import React from 'react';

function MessageDetail({ messages }) {
  return (
    <div>
      {messages.map(message => (
        <div key={message.message_no} className="message">
          <p>{message.message_content}</p>
          <p>Send Date: {message.send_date}</p>
          <p>Sender No: {message.sender_no}</p>
          <p>Receiver No: {message.receiver_no}</p>
          <p>Member No: {message.member_no}</p>
        </div>
      ))}
    </div>
  );
}

export default MessageDetail;
